import React from 'react';
import '../styles/Expedition.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import {EXPEDITION_PATH} from "../constants/routes";

class Expedition extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            enemyData: {},
            enemyId: 0,
        }
    }

    componentDidMount() {
        this.props.sendGetRequest(EXPEDITION_PATH)
            .then((response) => {
                this.setState({enemyData: response['data']['enemy']});
                this.setState({enemyId: response['data']['id']});
                console.log(this.state.enemyData);
                console.log(this.state.enemyId);
            }).catch((error) => {
                console.log(error.response);
        })
    }

    render() {
        return (
            <div>
                <Container fluid>
                    <Row>
                        <Col xs={{ order:0 }}>
                            <p> Expedition Lorem Ipsum </p>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Expedition;
